import React from 'react'
import styled from 'styled-components'

const InfoTab = styled.div`
    background-color: #cccaca;
    width: 20rem;
    border-color: grey;
    border-width: 1px;
    border-radius: 20px;
    height: 20rem;

`
const Time= styled.div`
    font-size: 30px;
    color: black;
`    

const Date = styled.div`
    font-size: 20px;
    color: black;
`

const Info= ()=>{
    return(
        <InfoTab>
            <Time>10:26 pm</Time>
            <Date>18-10-2021</Date>
        </InfoTab>
    )
}
export default Info
